import Component from 'react'
import {BrowserRouter, Route, Routes} from 'react-router-dom'
import Home from './Component/'
class App extends Component {
    render(){
        return(
           <BrowserRouter>
              <Routes>
                <Route exact path='/' Component={Home}/>
              </Routes>
           </BrowserRouter>
        )
    }
}

export default App
